import { Typography } from '@mui/material';
import Box from '@mui/material/Box';
import React from 'react'

interface DataProps{
    label: string;
    value: string
}

const TextData: React.FC<DataProps> = ({label,value}:DataProps)=>{
    return(
        <>
        <Box
        sx={{
            marginTop:'24px',
            display: 'flex',
            color:"black"
        }}>
            <Typography variant='body1' sx={{color:'#fff'}}>
                {label}
            </Typography>

        </Box>
        <Box sx={{marginTop:"8px", color:"black"}}>
            <Typography variant='h1' sx={{color:"#fff"}}>
                {value}
            </Typography>

        </Box>
        </>
    )
}

export default TextData;
